import React from 'react';
import './Task.css'

export default (props) => {
    const { task, editTask, deleteTask } = props;
    const { id, name, todo, passid } = task
    return (
        <li >
            <div className="id">Commit : {id}</div>

            <div className="passid">ID : {passid}</div>
            <div className="name">{name}</div>
            <div className="todo">{todo}</div>

            <div className='bt-container'>
                <button className="edit" class="btn btn-success" onClick={() => editTask(id)} >Edit</button>
                <button className="del" class="btn btn-danger" onClick={() => deleteTask(id)} >Delete</button>
            </div>
        </li>
    )
}
